import styled from "styled-components";


export const Footer = styled.footer`

    height: 250px;
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: #111;
    color: #444;
    border-top: 1px solid #000;
    
    span{
        font-weight: bold;
        
    }
    

`
